import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Table, Pagination } from 'react-bootstrap';
import Main from '../components/Main';

const VendasGeral = () => {
    const [clientes, setClientes] = useState([]);
    const [currentPage, setCurrentPage] = useState(0);
    const [clientesPerPage] = useState(10);

    const fetchClientes = async (page) => {
        const token = localStorage.getItem('token');
        try {
            const response = await axios.get(`${process.env.REACT_APP_API_URL}/clientes?page=${page}&size=${clientesPerPage}`, {
                headers: {
                    Authorization: `Bearer ${token}`,
                },
            });
            setClientes(response.data.content);
        } catch (error) {
            console.error('Erro ao obter a quantidade de vendas:', error);
        }
    };
    

    useEffect(() => {
        fetchClientes(currentPage);
    }, [currentPage]);

    const paginate = (pageNumber) => {
        setCurrentPage(pageNumber - 1);
        fetchClientes(pageNumber - 1);
    };

    const renderPageNumbers = () => {
        const totalPages = response?.data?.totalPages || 0;
        const maxVisiblePages = 4; // Ajuste conforme necessário
        const startPage = Math.max(currentPage - Math.floor(maxVisiblePages / 2), 0);
        const endPage = Math.min(startPage + maxVisiblePages, totalPages);

        return Array.from({ length: endPage - startPage }, (_, index) => startPage + index + 1).map((page) => (
            <Pagination.Item key={page} active={page - 1 === currentPage} onClick={() => paginate(page)}>
                {page}
            </Pagination.Item>
        ));
    };

    return (
        <Main>
            <div className="container-fluid">
                <h1 className="h3 mb-2 text-gray-800">Tabela Vendas Gerais</h1>

                <div className="card shadow mb-4">
                    <div className="card-header py-3">
                        <h6 className="m-0 font-weight-bold text-success">Clientes</h6>
                    </div>
                    <div className="card-body">
                        <div className="table-responsive">
                            <Table bordered hover>
                                <thead>
                                    <tr>
                                        <th>Nome</th>
                                        <th>Telefone 1</th>
                                        <th>Telefone 2</th>
                                        <th>Plataforma</th>
                                        <th>Email</th>
                                        <th>Vendas</th>
                                    </tr>
                                </thead>
                                <tbody>
                                    {clientes.map((cliente) => (
                                        <tr key={cliente.id}>
                                            <td>{cliente.nome}</td>
                                            <td>{cliente.numeroTelefone1}</td>
                                            <td>{cliente.numeroTelefone2}</td>
                                            <td>{cliente.plataforma}</td>
                                            <td>{cliente.email}</td>
                                            <td>{cliente.venda ? cliente.venda.length : 0}</td>
                                        </tr>
                                    ))}
                                </tbody>
                            </Table>
                        </div>
                        <Pagination className="custom-pagination">
                            {renderPageNumbers()}
                        </Pagination>
                    </div>
                </div>
            </div>
        </Main>
    );
};

export default VendasGeral;
